inline int mod(int x) {while (x>=MOD) x-=MOD;while (x<0) x+=MOD;return x;}

inline int Get(char ch)
{
	if (isdigit(ch)) return ch-'0';
	if (isupper(ch)) return ch-'A'+10;
	if (islower(ch)) return ch-'a'+36;
	if (ch=='+') return 62;
	if (ch=='-') return 63;
	if (ch=='*') return 64;
	if (ch=='$') return 65;
}

inline int toten(string s)
{
	int res=0,i;
	for (i=0;i<=4;i++) res=res*66+Get(s[i]);
	return res;
}

LL curfac;int cursum,curss;

inline void getss(int n)
{
	int res=n/200000,pos=res*200000;
	curfac=toten(fac.substr(res*5,5));cursum=toten(sum.substr(res*5,5));curss=toten(ss.substr(res*5,5));
	for (register int i=pos+1;i<=n;i++)
	{
		curfac=(curfac*i)%MOD;
		cursum=mod(cursum+curfac);
		curss=mod(curss+cursum);
	}
	curfac=(curfac*(n+1))%MOD;
	cursum=mod(cursum+curfac);
	curfac=(curfac*(n+2))%MOD;
}

int main ()
{
	int n,ca;scanf("%d",&ca);
	while (ca--)
	{
		scanf("%d",&n);
		if (n==1) {puts("0");continue;}
		getss(n-2);
		int ans=curfac,ans1=cursum,ans2=curss;
		ans=mod(ans-mod((2ll*ans1)%MOD-1));
		ans=mod(ans+ans2);
		printf("%d\n",ans);
	}
	return 0;
}
